import React from 'react';
import { Link } from 'react-router-dom';

const Player = (props) => {
  return (
    <ul>
      {props.data.map((item) =>
      <div>
        <li key={item.index} ><Link to={`/players/${item.id}`}>Score: {item.score}</Link></li>
        </div>
      )}
      <div className="gap-20"></div>
    </ul>
  );
}

export default Player;
